import React from "react";

const About = () => {
  return (
    <section id="about" className="py-16 px-6 bg-white">
      <div className="max-w-4xl mx-auto">
        <h3 className="text-3xl font-bold mb-6">About Me</h3>
        <p className="text-lg text-gray-700">
          I’m a passionate Software Engineering graduate who loves building meaningful products. I’ve worked on a variety of web applications, especially in healthcare and education. At Ace Med Assist, I help healthcare providers grow their practice through digital strategies. I specialize in full-stack web development and marketing automation.
        </p>
      </div>
    </section>
  );
};

export default About;
